    { id: 'q1', author: 'Nam', text: 'Learning React is fun!' },
    { id: 'q2', author: 'NamP', text: 'Learning React is very fun!' }
]

const AllQuotes = () => {
    return <QuoteList quotes={DUMMY_QUOTES} />
};

export default AllQuotes;
